import React, { Component } from 'react';
import Form from './Components/Form/Form';
import './App.css';
import Particles from 'react-particles-js';

const particlesOptions = {
                particles: {
                  line_linked: {
                    shadow: {
                      enable: true,
                      color: "#3CA9D1",
                      blur: 10
                    }
                  }
                }
              }

class App extends Component {
  render() {
    return (
      <div className="App">
         <Particles 
              params={particlesOptions}
            />
        <Form />
      </div>
    );
  }
}

export default App;
